import{_ as t,o as g,c as s,R as m}from"./chunks/framework.-otb-FOr.js";const h=JSON.parse('{"title":"夜游黄浦江","description":"","frontmatter":{},"headers":[],"relativePath":"Life/夜上海.md","filePath":"Life/夜上海.md","lastUpdated":1749981190000}'),e={name:"Life/夜上海.md"},p=m('<h1 id="夜游黄浦江" tabindex="-1">夜游黄浦江 <a class="header-anchor" href="#夜游黄浦江" aria-label="Permalink to &quot;夜游黄浦江&quot;">​</a></h1><p>&quot;夜上海，夜上海，你是个不夜城......&quot;</p><p>​ 距离上次来上海旅行已经过去了两年时间，当时虽然呆了十天之久，但并未体验到黄浦江游船甚至是两元的轮渡，深感遗憾. 这次借着会议的安排，顺利登上&quot;船长三号&quot;. 入夜前的江景已让人心旷神怡.</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20230819_173943.jpg" alt=""></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20230819_175625.jpg" alt="IMG_20230819_175625"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20230819_174120.jpg" alt="IMG_20230819_174120"></p><p>​ 夜色渐浓，华灯初上，黄浦江游船缓缓向前行驶, 带我感受着魔都的城市魅力. 江风吹过，消解了八月的炎炎暑气. 灯火辉煌的外滩早已尽收眼底，每一栋大厦都散发着独特的气息。此时此刻，这座城市，它充满了生机与活力。岸边围满了形形色色的人群，情侣手牵手漫步，享受着浪漫的时光；家人簇拥在一起，拍照记录这欢乐的时光；还有孤独的行者，沉浸在自己的世界里，他们共同构成了这座城市的灵魂。在这个沉醉的夜晚，耀眼的东方明珠将见证人们的梦想与希望，也会窥探出每个人生活的泥泞与挣扎。幸运的是，今夜过后，一切回归本位，他们继续在这个城市中交织、碰撞，创造出更多城市记忆。</p><p>​ 游船继续向前行驶，穿越着这个城市的心脉. 我的思绪渐渐飘回，想着活在当下才是更重要的事，于是决意将所有烦恼抛之脑后，今朝有酒今朝醉，沉浸式体验醉生梦死之感.</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/mmexport1692457438958.jpg" alt="mmexport1692457438958"></p><p>暂凭杯酒长精神</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/mmexport1692457433795.jpg" alt="mmexport1692457433795"></p><hr><h1 id="开会留念" tabindex="-1">开会留念 <a class="header-anchor" href="#开会留念" aria-label="Permalink to &quot;开会留念&quot;">​</a></h1><p>纪念品: 薅尽会议的羊毛</p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/mmexport1692334803765.jpg" alt="mmexport1692334803765" style="zoom:25%;"><p>炫个DQ双头怪</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/2023-08-20-15-22-59-840.jpg" alt="2023-08-20-15-22-59-840"></p><h1 id="经年往事-2021" tabindex="-1">经年往事(2021) <a class="header-anchor" href="#经年往事-2021" aria-label="Permalink to &quot;经年往事(2021)&quot;">​</a></h1><p><strong>回顾2021年初来上海时见到的风景.</strong></p><p>白天的外滩同样震撼.</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210714_174945.jpg" alt="IMG_20210714_174945"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210719_142220.jpg" alt="IMG_20210719_142220"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210719_141738.jpg" alt="IMG_20210719_141738"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210714_175716.jpg" alt="IMG_20210714_175716"></p><p>外白渡桥</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210714_174732.jpg" alt="IMG_20210714_174732"></p><p>老城隍(看来那天的天气不咋好)</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210719_145550.jpg" alt="IMG_20210719_145550"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/B612Kaji_20210713_122918_986.jpg" alt="B612Kaji_20210713_122918_986"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210719_145330.jpg" alt="IMG_20210719_145330"></p><p>夜景还不错哦</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210719_144747.jpg" alt="IMG_20210719_144747"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210713_200433.jpg" alt="IMG_20210713_200433"></p><p>南京路步行街</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210719_140807.jpg" alt="南京路步行街"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210713_193543.jpg" alt="IMG_20210713_193543"></p><p>武康大楼</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210712_110816_1.jpg" alt="IMG_20210712_110816_1"></p><p>1192弄</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210714_150636.jpg" alt="IMG_20210714_150636"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210719_141453.jpg" alt="IMG_20210719_141453"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210714_151013.jpg" alt="IMG_20210714_151013"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210719_142721.jpg" alt="IMG_20210719_142721"></p><p>1933老厂坊</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210719_134158.jpg" alt="IMG_20210719_134158"></p><p>几何书店</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210714_160102.jpg" alt="IMG_20210714_160102"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210714_160601.jpg" alt="IMG_20210714_160601"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210714_160133.jpg" alt="IMG_20210714_160133"></p><p>中华美术馆</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210718_163427.jpg" alt="IMG_20210718_163427"></p><p>朱家角古镇(远离城市的喧嚣, 颇有江南水乡的风情)</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210715_144413.jpg" alt="IMG_20210715_144413"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/mmexport1626578085334.jpg" alt="mmexport1626578085334"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210715_145423.jpg" alt="IMG_20210715_145423"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210715_134943.jpg" alt="IMG_20210715_134943"></p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/IMG_20210715_145820.jpg" alt="IMG_20210715_145820"></p><p>唯一的美食记录：蟹黄面</p><p><img src="https://gitee.com/yixin-oss/blogImage/raw/master/Img/2021-07-13-14-54-00-200.jpg" alt="2021-07-13-14-54-00-200"></p>',59),a=[p];function i(o,r,_,I,c,l){return g(),s("div",null,a)}const G=t(e,[["render",i]]);export{h as __pageData,G as default};
